    state={
        people:[
            "Shashi Koshy",
            "Dhriti Taneja",
            "Dipa Mishra",
            "Ansh Thakkar",
            "Lakshmi Thaker",
            "Sushila Matthai",
            "Shresth Nigam",
            "Bhavana Biswas",
            "Vasudha Mangat",
            "Priya Saran"
           ],
           r:false,
           l:false,
           b:false
    }
    render() {
        return (
            <div>
                <div className="form-check">
                    <input className="form-check-input" type="checkbox" value="" id="flexCheckDefault" on/>
                    <label class="form-check-label" for="flexCheckDefault">includes R or r</label>
                </div>
                <div className="form-check">
                    <input className="form-check-input" type="checkbox" value="" id="flexCheckDefault"/>
                    <label class="form-check-label" for="flexCheckDefault">length {'>'} 14</label>
                </div>
                <div className="form-check">
                    <input className="form-check-input" type="checkbox" value="" id="flexCheckDefault"/>
                    <label class="form-check-label" for="flexCheckDefault">start with "bh"</label>
                </div>
            </div>
        );
    }

}

export default Filtercom;
